// Avatar images
const avatars = [
  '/avatars/avatar1.svg',
  '/avatars/avatar2.svg', 
  '/avatars/avatar3.svg',
  '/avatars/avatar4.svg',
  '/avatars/avatar5.svg',
  '/avatars/avatar6.svg'
];

export const getRandomAvatar = () => {
  const randomIndex = Math.floor(Math.random() * avatars.length);
  return avatars[randomIndex];
};

export default avatars;
